using Rubin
using Tests
using Elliptic
using HypergeometricFunctions
using Polylogarithms
using SpecialFunctions

@test integrate(x^5*arccot(a*x), x) == :(-1//6*a^-6*arctan(a*x)+-1//18*a^-3*x^3+1//6*x*a^-5+1//6*x^6*arccot(a*x)+1//30*a^-1*x^5)
@test integrate(x^4*arccot(a*x), x) == :(-1//10*a^-3*x^2+1//5*x^5*arccot(a*x)+1//10*a^-5*log(1+a^2*x^2)+1//20*a^-1*x^4)
@test integrate(x^3*arccot(a*x), x) == :(-1//4*x*a^-3+1//4*a^-4*arctan(a*x)+1//4*x^4*arccot(a*x)+1//12*a^-1*x^3)
@test integrate(x^2*arccot(a*x), x) == :(-1//6*a^-3*log(1+a^2*x^2)+1//3*x^3*arccot(a*x)+1//6*a^-1*x^2)
@test integrate(x*arccot(a*x), x) == :((1/2)*x*a^-1+(1/2)*x^2*arccot(a*x)+-1//2*a^-2*arctan(a*x))
@test integrate(arccot(a*x), x) == :(x*arccot(a*x)+(1/2)*a^-1*log(1+a^2*x^2))
@test integrate(x^-1*arccot(a*x), x) == :((1/2)*im*Polylogarithms.polylog(2,im*a^-1*x^-1)+-1//2*im*Polylogarithms.polylog(2,-1*im*a^-1*x^-1))
@test integrate(x^-2*arccot(a*x), x) == :((1/2)*a*log(1+a^2*x^2)+-1*a*log(x)+-1*x^-1*arccot(a*x))
@test integrate(x^-3*arccot(a*x), x) == :((1/2)*a*x^-1+(1/2)*a^2*arctan(a*x)+-1//2*x^-2*arccot(a*x))
@test integrate(x^-4*arccot(a*x), x) == :(-1//3*x^-3*arccot(a*x)+-1//6*a^3*log(1+a^2*x^2)+1//3*a^3*log(x)+1//6*a*x^-2)
@test integrate(x^-5*arccot(a*x), x) == :(-1//4*a^3*x^-1+-1//4*a^4*arctan(a*x)+-1//4*x^-4*arccot(a*x)+1//12*a*x^-3)
@test integrate(x^5*arccot(a*x)^2, x) == :(-4//45*a^-4*x^2+1//6*a^-6*arccot(a*x)^2+1//6*x^6*arccot(a*x)^2+1//60*a^-2*x^4+23//90*a^-6*log(1+a^2*x^2)+-1//9*a^-3*x^3*arccot(a*x)+1//3*x*a^-5*arccot(a*x)+1//15*a^-1*x^5*arccot(a*x))
@test integrate(x^4*arccot(a*x)^2, x) == :(-3//10*x*a^-4+1//5*x^5*arccot(a*x)^2+1//30*a^-2*x^3+3//10*a^-5*arctan(a*x)+-2//5*a^-5*arccot(a*x)*log(2*(1+im*a*x)^-1)+-1//5*a^-3*x^2*arccot(a*x)+1//5*im*a^-5*arccot(a*x)^2+1//5*im*a^-5*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)+1//10*a^-1*x^4*arccot(a*x))
@test integrate(x^3*arccot(a*x)^2, x) == :(-1//3*a^-4*log(1+a^2*x^2)+-1//4*a^-4*arccot(a*x)^2+1//4*x^4*arccot(a*x)^2+1//12*a^-2*x^2+-1//2*x*a^-3*arccot(a*x)+1//6*a^-1*x^3*arccot(a*x))
@test integrate(x^2*arccot(a*x)^2, x) == :(-1//3*a^-3*arctan(a*x)+1//3*x*a^-2+1//3*x^3*arccot(a*x)^2+-1//3*im*a^-3*arccot(a*x)^2+-1//3*im*a^-3*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)+1//3*a^-1*x^2*arccot(a*x)+2//3*a^-3*arccot(a*x)*log(2*(1+im*a*x)^-1))
@test integrate(x*arccot(a*x)^2, x) == :((1/2)*a^-2*arccot(a*x)^2+(1/2)*a^-2*log(1+a^2*x^2)+(1/2)*x^2*arccot(a*x)^2+x*a^-1*arccot(a*x))
@test integrate(arccot(a*x)^2, x) == :(x*arccot(a*x)^2+im*a^-1*arccot(a*x)^2+im*a^-1*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)+-2*a^-1*arccot(a*x)*log(2*(1+im*a*x)^-1))
@test integrate(x^-1*arccot(a*x)^2, x) == :((1/2)*Polylogarithms.polylog(3,1+-2*a*x*(im+a*x)^-1)+-1//2*Polylogarithms.polylog(3,1+-2*im*(im+a*x)^-1)+2*arccot(a*x)^2*arccoth(1+-2*(1+im*a*x)^-1)+im*Polylogarithms.polylog(2,1+-2*a*x*(im+a*x)^-1)*arccot(a*x)+-1*im*Polylogarithms.polylog(2,1+-2*im*(im+a*x)^-1)*arccot(a*x))
@test integrate(x^-2*arccot(a*x)^2, x) == :(-1*x^-1*arccot(a*x)^2+-1*im*a*arccot(a*x)^2+-1*im*a*Polylogarithms.polylog(2,-1+2*(1+-1*im*a*x)^-1)+-2*a*arccot(a*x)*log(2+-2*(1+-1*im*a*x)^-1))
@test integrate(x^-3*arccot(a*x)^2, x) == :(a^2*log(x)+-1//2*a^2*arccot(a*x)^2+-1//2*a^2*log(1+a^2*x^2)+-1//2*x^-2*arccot(a*x)^2+a*x^-1*arccot(a*x))
@test integrate(x^-4*arccot(a*x)^2, x) == :(-1//3*a^2*x^-1+-1//3*a^3*arctan(a*x)+-1//3*x^-3*arccot(a*x)^2+1//3*im*a^3*arccot(a*x)^2+1//3*im*a^3*Polylogarithms.polylog(2,-1+2*(1+-1*im*a*x)^-1)+1//3*a*x^-2*arccot(a*x)+2//3*a^3*arccot(a*x)*log(2+-2*(1+-1*im*a*x)^-1))
@test integrate(x^-5*arccot(a*x)^2, x) == :(-2//3*a^4*log(x)+-1//4*x^-4*arccot(a*x)^2+-1//12*a^2*x^-2+1//3*a^4*log(1+a^2*x^2)+1//4*a^4*arccot(a*x)^2+-1//2*a^3*x^-1*arccot(a*x)+1//6*a*x^-3*arccot(a*x))
@test integrate(x^5*arccot(a*x)^3, x) == :(-19//60*x*a^-5+1//6*a^-6*arccot(a*x)^3+1//6*x^6*arccot(a*x)^3+1//60*a^-3*x^3+19//60*a^-6*arctan(a*x)+(1/2)*x*a^-5*arccot(a*x)^2+-23//15*a^-6*arccot(a*x)*log(2*(1+im*a*x)^-1)+-4//15*a^-4*x^2*arccot(a*x)+-1//6*a^-3*x^3*arccot(a*x)^2+1//10*a^-1*x^5*arccot(a*x)^2+1//20*a^-2*x^4*arccot(a*x)+23//30*im*a^-6*arccot(a*x)^2+23//30*im*a^-6*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1))
@test integrate(x^4*arccot(a*x)^3, x) == :(-9//20*a^-5*arccot(a*x)^2+-3//10*a^-5*Polylogarithms.polylog(3,1+-2*(1+im*a*x)^-1)+-1//2*a^-5*log(1+a^2*x^2)+1//5*x^5*arccot(a*x)^3+1//20*a^-3*x^2+-9//10*x*a^-4*arccot(a*x)+-3//5*a^-5*arccot(a*x)^2*log(2*(1+im*a*x)^-1)+-3//10*a^-3*x^2*arccot(a*x)^2+1//5*im*a^-5*arccot(a*x)^3+1//10*a^-2*x^3*arccot(a*x)+3//20*a^-1*x^4*arccot(a*x)^2+3//5*im*a^-5*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)*arccot(a*x))
@test integrate(x^3*arccot(a*x)^3, x) == :(-1//4*a^-4*arccot(a*x)^3+-1//4*a^-4*arctan(a*x)+1//4*x*a^-3+1//4*x^4*arccot(a*x)^3+-1*im*a^-4*arccot(a*x)^2+-1*im*a^-4*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)+2*a^-4*arccot(a*x)*log(2*(1+im*a*x)^-1)+-3//4*x*a^-3*arccot(a*x)^2+1//4*a^-1*x^3*arccot(a*x)^2+1//4*a^-2*x^2*arccot(a*x))
@test integrate(x^2*arccot(a*x)^3, x) == :((1/2)*a^-3*arccot(a*x)^2+(1/2)*a^-3*Polylogarithms.polylog(3,1+-2*(1+im*a*x)^-1)+(1/2)*a^-3*log(1+a^2*x^2)+1//3*x^3*arccot(a*x)^3+x*a^-2*arccot(a*x)+a^-3*arccot(a*x)^2*log(2*(1+im*a*x)^-1)+(1/2)*a^-1*x^2*arccot(a*x)^2+-1//3*im*a^-3*arccot(a*x)^3+-1*im*a^-3*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)*arccot(a*x))
@test integrate(x*arccot(a*x)^3, x) == :((1/2)*a^-2*arccot(a*x)^3+(1/2)*x^2*arccot(a*x)^3+-3*a^-2*arccot(a*x)*log(2*(1+im*a*x)^-1)+3//2*im*a^-2*arccot(a*x)^2+3//2*im*a^-2*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)+3//2*x*a^-1*arccot(a*x)^2)
@test integrate(arccot(a*x)^3, x) == :(x*arccot(a*x)^3+-3//2*a^-1*Polylogarithms.polylog(3,1+-2*(1+im*a*x)^-1)+im*a^-1*arccot(a*x)^3+-3*a^-1*arccot(a*x)^2*log(2*(1+im*a*x)^-1)+3*im*a^-1*Polylogarithms.polylog(2,1+-2*(1+im*a*x)^-1)*arccot(a*x))
@test integrate(x^-1*arccot(a*x)^3, x) == :(2*arccot(a*x)^3*arccoth(1+-2*(1+im*a*x)^-1)+-3//2*Polylogarithms.polylog(3,1+-2*im*(im+a*x)^-1)*arccot(a*x)+-3//4*im*Polylogarithms.polylog(4,1+-2*a*x*(im+a*x)^-1)+3//2*Polylogarithms.polylog(3,1+-2*a*x*(im+a*x)^-1)*arccot(a*x)+3//4*im*Polylogarithms.polylog(4,1+-2*im*(im+a*x)^-1)+-3//2*im*arccot(a*x)^2*Polylogarithms.polylog(2,1+-2*im*(im+a*x)^-1)+3//2*im*arccot(a*x)^2*Polylogarithms.polylog(2,1+-2*a*x*(im+a*x)^-1))
@test integrate(x^-2*arccot(a*x)^3, x) == :(-1*x^-1*arccot(a*x)^3+-3//2*a*Polylogarithms.polylog(3,-1+2*(1+-1*im*a*x)^-1)+-1*im*a*arccot(a*x)^3+-3*a*arccot(a*x)^2*log(2+-2*(1+-1*im*a*x)^-1)+-3*im*a*Polylogarithms.polylog(2,-1+2*(1+-1*im*a*x)^-1)*arccot(a*x))
@test integrate(x^-3*arccot(a*x)^3, x) == :(-1//2*a^2*arccot(a*x)^3+-1//2*x^-2*arccot(a*x)^3+3*a^2*arccot(a*x)*log(2+-2*(1+-1*im*a*x)^-1)+3//2*im*a^2*arccot(a*x)^2+3//2*im*a^2*Polylogarithms.polylog(2,-1+2*(1+-1*im*a*x)^-1)+3//2*a*x^-1*arccot(a*x)^2)
@test integrate(x^-4*arccot(a*x)^3, x) == :((1/2)*a^3*arccot(a*x)^2+(1/2)*a^3*Polylogarithms.polylog(3,-1+2*(1+-1*im*a*x)^-1)+(1/2)*a^3*log(1+a^2*x^2)+-1*a^3*log(x)+-1//3*x^-3*arccot(a*x)^3+a^3*arccot(a*x)^2*log(2+-2*(1+-1*im*a*x)^-1)+(1/2)*a*x^-2*arccot(a*x)^2+-1*a^2*x^-1*arccot(a*x)+1//3*im*a^3*arccot(a*x)^3+im*a^3*Polylogarithms.polylog(2,-1+2*(1+-1*im*a*x)^-1)*arccot(a*x))
@test integrate(x^-5*arccot(a*x)^3, x) == :(-1//4*x^-4*arccot(a*x)^3+1//4*a^3*x^-1+1//4*a^4*arccot(a*x)^3+1//4*a^4*arctan(a*x)+-1*im*a^4*arccot(a*x)^2+-1*im*a^4*Polylogarithms.polylog(2,-1+2*(1+-1*im*a*x)^-1)+-2*a^4*arccot(a*x)*log(2+-2*(1+-1*im*a*x)^-1)+-3//4*a^3*x^-1*arccot(a*x)^2+-1//4*a^2*x^-2*arccot(a*x)+1//4*a*x^-3*arccot(a*x)^2)
